import React from 'react';
import {Helmet} from 'react-helmet';

import CoverPage from './pages/CoverPage'
import './App.css';

function App() {
  return (
    <div className="App">
      <Helmet>
        <title>Rene's Portfolio</title>
        <link rel="stylesheet"
          href="https://fonts.googleapis.com/css?family=Playfair&display=swap"></link>
      </Helmet>
      <CoverPage />
    </div>
  );
}

export default App;
